import { PlusIcon } from "@heroicons/react/outline";
import Rightbar from "../Sidebars/Rightbar.jsx";
import Posts from "./Posts.jsx";

function Feed() {
    return (

    <div className="overflow-y-scroll">

        <div className="flex justify-center">

            {/* Button */}
            <div className="bg-gradient-to-r bg-gray-700 hover:from-pink-500 hover:to-yellow-500 flex mt-1 sm:m-3 py-2 px-4 items-center cursor-pointer  font-bold rounded-full shadow-xl">
                <PlusIcon className="p-0.5 h-7 text-white"/>
                <p className="text-white">Social Post</p>
            </div>

        </div>

       <Posts/>
       <Rightbar/>

    </div>
    )
}

export default Feed;
